import {
  useNavigate,
  useLocation
} from "react-router-dom";

function WeatherInfo() {
    const location = useLocation();    
    var history = useNavigate();
    var person;
    fetch('https://goweather.herokuapp.com/weather/stockholm')
        .then(({ results }) => alert());
    return (
        <body>  
            <h1>{person}</h1>
        </body>
  );
}

export default WeatherInfo;
